    <>
      <BrowserRouter>
        <div style={{
          display: "flex",
          background: '#d2dbdd',
          padding: '5px 0 5px 5px',
          fontSize: '30px',
          fontFamily: 'cursive',
          marginLeft: '50px',
          marginRight: '20px',
          marginTop: '10px',
          textAlign: 'center'


        }}>
          <Routes>
            <Route exact path='/' element={<Login />} />
            <Route exact path="/login" element={<Login />} />
            <Route exact path="/register" element={<Register />} />
